script: |
  super -f text -I q1295.spq | sort > q1295.out

inputs:
  - name: q1295.spq
    data: |
      SELECT DISTINCT + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * + - col2 IS NULL OR NOT NULL BETWEEN NULL AND - col2 + - 95;
  - name: tab1

outputs:
  - name: q1295.out
    data: |
      3
